import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import data from './data/medicines.json';
import MedicineCarousel from './components/medicine_carousel'
function App() {
  const newdata = data.map(data => {
    return (
      <div className="row medicine">
        <div className="col-lg-3"><img className="medicine_image" src={data.image} /></div>
        <div className="col-lg-9"><p className="medicine_name">{data.name}</p>
          <p className="medicine_description">{data.description}</p></div>
      </div>
    );
  });
  //return (<div className="container medicines_list">{newdata}</div>);
  return (<MedicineCarousel />)
}

export default App;
